query pages_indexQuery(
  $city: String!
) {
  weather_getCityByName(name: $city) {
    weather {
      temperature {
        actual
        feelsLike
      }
      summary {
        ...Weather_Details
      }
    }
    id
  }
}

fragment Weather_Details on weather_Summary {
  title
  description
}

